What Makes us Human

Science Documentary hosted by Alice Roberts, published by BBC broadcasted as part of BBC Horizon series in 2013 - English narration


Information
------------------------------

Professor Alice Roberts is pregnant with her second child but before he is born, she wants to find out what makes a human? Humans share 99% of our DNA with chimpanzees and yet from the moment of birth, our lives are completely different. So are humans just another animal, or is there something special about being human? Before her new baby emerges into the world, Professor Roberts sets out to explore what it is about our bodies, our genes, and ultimately our brains that set us apart from our furry cousins - what is it that truly makes us human?

